import React from 'react';

const VideoSection = () => {
  return (
    <div className="video-section di bg-[#072F57] w-[1316px] h-[623px] m-auto p-16">
   
   
      <iframe
        width="560"
        height="315"
        src="https://www.youtube.com/embed/dQw4w9WgXcQ"
        title="YouTube video"
        className="mx-auto"
        allowFullScreen
      ></iframe>
   <div>

   </div>
    </div>
  );
};

export default VideoSection;
